import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';



const Targets = () => {
  const handleButtonClick = (buttonNumber) => {
    console.log(`Button ${buttonNumber} clicked!`);
    // You can add your desired logic for handling button clicks here
  };

  return (
    <div
      className="container-fluid bg-secondary d-flex justify-content-center align-items-center"
      role="group"
      aria-label="Button group with nested dropdown"
      style={{ height: '90vh' }}
    >
      <div className="btn-group" role="group" style={{ height: '15vh' }}>
        <button
          id="btnGroupDrop1"
          type="button"
          className="btn btn-danger dropdown-toggle"
        //   data-toggle="dropdown"
          aria-haspopup="true"
          aria-expanded="false"
          onClick={() => handleButtonClick(1)}
        >
          Please Select A Target
        </button>
        <div class="dropdown-menu" aria-labelledby="btnGroupDrop1">
        <a class="dropdown-item" href="#">Dropdown link</a>
        <a class="dropdown-item" href="#">Dropdown link</a>
        </div>
      </div>
    </div>
  );
};

export default Targets;
